import React from "react";
import Header from "./Components/Header";
import Users from "./Components/users";

class App extends React.Component {
  render() {
    return (
      <div>
        <Header title="Users list" />
        <main>
          <Users />
        </main>
        <aside></aside>
      </div>
    );
  }
}

export default App;
